"""
We have jobs: difficulty[i] is the difficulty of the ith job, and profit[i] is the profit of the ith job.

Now we have some workers. worker[i] is the ability of the ith worker, which means that this worker can only complete a job with difficulty at most worker[i].

Every worker can be assigned at most one job, but one job can be completed multiple times.

For example, if 3 people attempt the same job that pays $1, then the total profit will be $3.  If a worker cannot complete any job, his profit is $0.

What is the most profit we can make?

Example 1:

Input: difficulty = [2,4,6,8,10], profit = [10,20,30,40,50], worker = [4,5,6,7]
Output: 100
Explanation: Workers are assigned jobs of difficulty [4,4,6,6] and they get profit of [20,20,30,30] seperately.

Notes:

    1 <= difficulty.length = profit.length <= 10000
    1 <= worker.length <= 10000
    difficulty[i], profit[i], worker[i]  are in range [1, 10^5]

"""


class Solution(object):
    def maxProfitAssignment(self, difficulty, profit, worker):
        """
        :type difficulty: List[int]
        :type profit: List[int]
        :type worker: List[int]
        :rtype: int
        1024 ms
        """
        import bisect, heapq
        p_d = []
        for pro, diff in zip(profit, difficulty):
            heapq.heappush(p_d, (-pro, diff))
        worker = sorted(worker)
        i = len(worker)
        ans = 0
        while p_d and i > 0:
            a = heapq.heappop(p_d)
            pro, diff = -a[0], a[1]
            pos = bisect.bisect_left(worker[0: i], diff)
            ans += (i - pos) * pro
            print(ans, pro, diff, pos)
            i = pos
        return ans

    def maxProfitAssignment_1(self, difficulty, profit, worker):
        """
        :type difficulty: List[int]
        :type profit: List[int]
        :type worker: List[int]
        :rtype: int
        144MS
        """
        jobs = sorted([a, b] for a, b in zip(difficulty, profit))
        res = i = maxp = 0
        for ability in sorted(worker):
            while i < len(jobs) and ability >= jobs[i][0]:
                maxp = max(jobs[i][1], maxp)
                i += 1
            res += maxp
        return res

    def maxProfitAssignment_2(self, difficulty, profit, worker):
        """
        :type difficulty: List[int]
        :type profit: List[int]
        :type worker: List[int]
        :rtype: int
         524 ms
        """
        import bisect
        p_d = []
        for pro, diff in zip(profit, difficulty):
            p_d.append([pro, diff])
        p_d = sorted(p_d, key=lambda a:a[0], reverse=True)
        worker = sorted(worker)
        i = len(worker)
        ans = 0
        for job in p_d:
            if job[1] > worker[i - 1]:
                continue
            pos = bisect.bisect_left(worker[0: i], job[1])
            ans += (i - pos) * job[0]
            i = pos
            print(i)
        return ans
